// src/components/Navbar.jsx
import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const menuItems = [
  { name: 'AAMS', path: '/aams' },
  { name: 'Features', path: '/features' },
  { name: 'Demo', path: '/demo' },
  { name: 'Download', path: '/download' },
  { name: 'Pricing', path: '/pricing' },
  { name: 'Support', path: '/support' },
  { name: 'FAQ', path: '/faq' },
];

const Navbar = ({ isLoggedIn, handleLogin, handleLogout }) => {
  const [showDropdown, setShowDropdown] = useState(false);

  return (
    <nav className="bg-blue-600 text-white px-6 py-4 shadow relative">
      <div className="flex items-center space-x-4">
        <div className="relative">
          <button
            onClick={() => setShowDropdown(!showDropdown)}
            className="hover:underline font-semibold"
          >
            AAMS â–¾
          </button>

          {showDropdown && (
            <div className="absolute top-10 left-0 bg-white text-black rounded shadow-lg w-60 z-50">
              <ul className="divide-y divide-gray-200">
                {menuItems.map((item) => (
                  <li key={item.name} className="p-3 hover:bg-gray-100">
                    <div className="flex justify-between items-center">
                      <Link to={item.path} className="text-blue-600 hover:underline">
                        {item.name}
                      </Link>
                      {isLoggedIn ? (
                        <button
                          onClick={handleLogout}
                          className="text-sm text-red-500 hover:underline ml-2"
                        >
                          Logout
                        </button>
                      ) : (
                        <button
                          onClick={handleLogin}
                          className="text-sm text-green-500 hover:underline ml-2"
                        >
                          Login
                        </button>
                      )}
                    </div>
                  </li>
                ))}
              </ul>
            </div>
          )}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
